import { Link } from 'react-router-dom';
import { Menu } from 'antd';

export default function Header() {
    return (
        <header>
            <div className="logo" />
            <Menu mode="horizontal" className="headermenu">
                <Link to="/">
                    <Menu.Item key="1" className="header-text">HOME</Menu.Item>
                </Link>
                <Link to="/">
                    <Menu.Item key="2" className="header-text">BURGER</Menu.Item>
                </Link>
                <Link to="/">
                    <Menu.Item key="3" className="header-text">CONTACT</Menu.Item>
                </Link>

            </Menu>
        </header>
    );
}
